script: |
  super -f text -I q1689.spq | sort > q1689.out

inputs:
  - name: q1689.spq
    data: |
      SELECT ALL - 50 + - + col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - + col1 * - col2 AND - - col2 / + 51 / + col1 + + + col2 + + col1;
  - name: tab0

outputs:
  - name: q1689.out
    data: |
